import React from "react"

var name = "Khoi"


function Button(){
    return (
        <button className="btn">Click</button>
    )
}
function postItem(props){
    return (
        <div>
            <Button/>
            <button className={props.name}>
                {props.title}

            </button>



        </div>
    )
}
export default function MyApp(){
    return (
        <div>

            
            
            <postItem
                title="dksald"
                name="dkfasldjf"            
            /> 





        
        
        
        
        
        </div>
    )
}
